import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
//pages
import Home from "./Home";
import Jobpostpage from "./Jobpostpage";
//header with nav bar:
// import
const RouterWrapper = () => {
  return (
    <Router>
      <Route path="/">
        <Home />
      </Route>
      <Route path="/Jobpostpage">
        <Jobpostpage />
      </Route>
    </Router>
  );
};
